import "bootstrap/dist/css/bootstrap.min.css";

const Navbar = (props) => {
    
    return (
        <>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <a className="navbar-brand" href="/">
                    IMDb
                </a>
                <a className="navbar-brand" href="/movies">
                    Movies
                </a>
            </nav>
        </>
    );
};

export default Navbar;
